	public static int[] mergeSort(int[] arr, left, right) {
		//kasus dasar
		//ketika ukuran array sama dengan 1
		if (left == right) {
			int[] result = new int[1];
			result[0] = arr[left];
			return result;
		}

		//kasus rekursif
		int mid = (left + right) / 2;
		int[] leftArr = mergeSort(arr, left, mid); //kiri
		int[] rightArr = mergeSort(arr, mid + 1, right); //kanan

		return merge(leftArr, rightArr); //gabungkan array kiri dan kanan


